Provide an education benefit modeled on the GI Bill concept:

- 60% of in-state tuition, or a job-training benefit up to $14,000, for a 1 yr commitment;
- 80% or a job-training benefit of up to $19,000 for a 2 yr commitment;
- 100% or $24,000 in training for a 3 yr commitment.

